		   [
			   {id:0,num:0,type:"",shift:""},
			   {id:1,num:0,type:"",shift:""}
		   ]
	}
	
	  render () {
		  const {title} = this.props;
	    return (
		    <div>
			   <h1 >{title}</h1>
			   <div>
			    Hostpital unit is <input name="unit" id="unit"/> and HPPD is <input name="HPPD" id="HPPD"/>
			   </div>
			   <div>
			   you census is <input name="census" id="census"/>% full in a  <input name="bedUnit" id="bedUnit"/> bed unit
			   </div>
			   <div>
			  Allocate your resources accordlingly
			   </div>
			   <div>
			    <button >Add Home Practice</button>
			    </div>
            </div>
		);
	  }
			
		
	
}
export default Info
